ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");


//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([name] like '%" + db.encode(searchText) + "%') or " +
        "([IDcard] like '%" + db.encode(searchText) + "%') or " + 
        "([phone] like '%" + db.encode(searchText) + "%') or " +
        "([inoculatestate] like '%" + db.encode(searchText) + "%') or " +
        "([codeEpc] like '%" + db.encode(searchText) + "%') or " +
        "([inoculatedoctor] like '%" + db.encode(searchText) + "%') or " + 
        "([inoculatehospital] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM inoculate " +
    "WHERE ([status] <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT * " +
    "FROM inoculate " +
    "WHERE (status <> 'DEL') " + condition +
    "ORDER BY id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 


eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"name,IDcard,phone,inoculatestate,codeEpc,inoculatedoctor,inoculatehospital,id", pageSize*(pageCurrent-1), pageSize);

